	image()
	{
		var instances = this.agents.length;
		
		var geometry  = SAFE_MODE ? this.geometrySafeMode() : this.geometry(),
			material  = SAFE_MODE ? this.materialSafeMode() : this.material(),
			mesh = new THREE.InstancedMesh( geometry, material, instances );

		mesh.infectionLevel = geometry.getAttribute( 'infectionLevel' );
		mesh.motionType = geometry.getAttribute( 'motionType' );
		mesh.mask = geometry.getAttribute( 'mask' );
//mesh.rotation.x = -Math.PI/2;
//mesh.position.y = 1;
//console.log(geometry.getAttribute('agentId').array);

		// create agents matrices
		var matrix = new THREE.Matrix4(),
			white = new THREE.Color( 'black' );
			
		for( var i=0; i<instances; i++ )
		{
			var agent = this.agents[i];
			matrix.makeScale( agent.height, agent.height, agent.height );
			matrix.setPosition( agent.position.x, agent.position.y, agent.position.z );

			if( !DEBUG_FORM_A_LINE )
			{
				// random rotation
				
				var	angle = DEBUG_FORM_A_CIRCLE ? -i/instances*2*Math.PI : THREE.Math.randFloat(0,2*Math.PI),
					sin = agent.height * Math.sin( angle ),
					cos = agent.height * Math.cos( angle );
				matrix.elements[0] = cos;
				matrix.elements[2] = -sin;
				matrix.elements[8] = sin;
				matrix.elements[10] = cos;
			}
			
			mesh.setMatrixAt( i, matrix );
			if( SAFE_MODE )
				mesh.setColorAt( i, white );
		}
		
		mesh.receiveShadow = true;
		if( AGENTS_CAST_SHADOWS ) mesh.castShadow = true;
				
		scene.add( mesh );
		return mesh;
	}
	
